import clsx from "clsx";
import LinkItem from "../staff/LinkItem";
import { Fiturs } from "./fiturAdmin";

const SidebarAdmin = ({ isSidebarOpen }) => {
    return (
        <aside
            className={clsx(
                "fixed top-0 left-0 z-40 w-64 h-screen",
                "bg-white border-r border-gray-200",
                "dark:bg-gray-800 dark:border-gray-700",
                "transition-transform",
                {
                    "translate-x-0": isSidebarOpen,
                    "-translate-x-full": !isSidebarOpen
                }
            )}
        >
            <div className="h-full flex flex-col">
                {/* Header */}
                <div className="flex items-center justify-center py-4 border-b border-gray-200 dark:border-gray-700">
                    <h1 className="text-xl font-semibold text-gray-900 dark:text-white">Salesai</h1>
                </div>

                {/* Menu */}
                <div className="flex-1 px-4 py-4 overflow-y-auto">
                    <ul className="space-y-2">
                        {Fiturs.map((link, index) => (
                            <li key={index}>
                                <LinkItem {...link} />
                            </li>
                        ))}
                    </ul>
                </div>

                {/* Footer */}
                <div className="py-4 border-t border-gray-200 dark:border-gray-700">
                    <ul className="space-y-2">
                        <li>
                            <button className="flex items-center px-4 py-2 text-gray-600 hover:bg-gray-100 dark:text-gray-400 dark:hover:bg-gray-700 rounded-lg">
                                <span className="material-icons">settings</span>
                                <span className="ml-3">Settings</span>
                            </button>
                        </li>
                        <li>
                            <button className="flex items-center px-4 py-2 text-gray-600 hover:bg-gray-100 dark:text-gray-400 dark:hover:bg-gray-700 rounded-lg">
                                <span className="material-icons">help</span>
                                <span className="ml-3">Help</span>
                            </button>
                        </li>
                    </ul>
                </div>
            </div>
        </aside>
    );
};

export default SidebarAdmin;
